def asc_desc_ending_sort(n, m, strings):
    indices = [i for i in range(1, n+1)]
    indices.sort(key=lambda x: strings[x-1])

    def compare_strings(a, b):
        for i in range(m):
            if i % 2 == 0:
                if strings[a-1][i] > strings[b-1][i]:
                    return 1
                elif strings[a-1][i] < strings[b-1][i]:
                    return -1
            else:
                if strings[a-1][i] < strings[b-1][i]:
                    return 1
                elif strings[a-1][i] > strings[b-1][i]:
                    return -1
        return 0

    indices.sort(key=compare_strings)
    return indices
